import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import jokeFacade from "./jokeFacade";
import { BrowserRouter as Router } from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
    <Router>
      <App jokeFacade={jokeFacade} />
    </Router>
  </React.StrictMode>,
  document.getElementById("root")
);
